import './styling/App.css';

function App() {



  function renderClasses ( data ) {
    const classNames = data.map((classes) => console.log(classes.name))
  }

  function getClasses() {
    fetch(`http://127.0.0.1:5555/game_classes`)
      .then(r => r.json())
      .then(data => renderClasses(data))
  }

  return (
    <div className="App">
      <button onClick={getClasses}>Click</button>
    </div>
  );
}





export default App;
